import React from "react";
import './Home.css';
import Header from "../Header/Header";


function Cart(){
    return(
        <div>
            <div>
                {/* <Header/> */}
            </div>
            <div id="cart">
            <div id="cart_container">
            <img id="cart_img"src={require("../assets/Images/cart.jpg")} alt="a" /><h1>My Cart</h1>
            </div>
            <div id="cart_container1">
            <img id="cart_img"src={require("../assets/Images/address.png")} alt="a" /><h1>Delivery address</h1>
            <button>Cancle</button>
            </div>
            <div id="cart_container">
            <img id="cart_img"src={require("../assets/Images/payment.png")} alt="a" /><h1>Payment</h1>  
            </div>
            </div>
        </div>
    )
}
export default Cart
